',NULL,NULL),(33,'language','[{\"id\":\"1\",\"name\":\"english\",\"direction\":\"ltr\",\"code\":\"en\",\"status\":1,\"default\":true},{\"id\":2,\"name\":\"English\",\"direction\":\"ltr\",\"code\":\"en-US\",\"status\":0,\"default\":false},{\"id\":5,\"name\":\"Frence\",\"direction\":\"ltr\",\"code\":\"fr\",\"status\":1,\"default\":false}]',NULL,'2024-04-08 11:18:53'),(34,'paypal','{\"status\":\"0\",\"paypal_client_id\":\"\",\"paypal_secret\":\"\"}','2022-04-10 09:41:04','2022-04-10 09:41:24'),(35,'privacy_policy','<p>&nbsp;</p>\r\n\r\n<p><strong>Sanaa Finance</strong>, a financial company in East Africa focused on providing financial tools, payments, and services to promote financial inclusion in the region.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Privacy Policy</strong></p>\r\n\r\n<p><strong>Effective Date: 17/05/2024</strong></p>\r\n\r\n<p>Thank you for choosing Sanaa Finance LTD (&quot;Sanaa Finance,&quot; &quot;we,&quot; &quot;us,&quot; or &quot;our&quot;). This Privacy Policy outlines how we collect, use, share, and protect your personal information when you use our financial tools, payments, and services. We are committed to safeguarding your privacy and ensuring the security of your information.</p>\r\n\r\n<p><strong>1. Information We Collect</strong></p>\r\n\r\n<p>We may collect various types of personal information from you, including but not limited to:</p>\r\n\r\n<p>- Name</p>\r\n\r\n<p>- Contact details (email address, phone number, mailing address)</p>\r\n\r\n<p>- Financial information (bank account details, transaction history)</p>\r\n\r\n<p>- Identification documents (passport, national ID)</p>\r\n\r\n<p>- <strong>Contact List:</strong> We collect information from your contact list to enhance our services, such as enabling seamless payments and improving user connectivity.</p>\r\n\r\n<p>- <strong>Images:</strong> We collect images you upload, which may include profile pictures, identification documents, or other relevant images.</p>\r\n\r\n<p><strong>2. How We Collect Information</strong></p>\r\n\r\n<p>We collect personal information through various channels, including:</p>\r\n\r\n<p>- Online forms on our website or mobile applications</p>\r\n\r\n<p>- Communications with our customer support team</p>\r\n\r\n<p>- Interactions with our products and services, including transactional data</p>\r\n\r\n<p>- <strong>Access to Contact List and Images:</strong> When you use features that require access to your contact list and images, we collect this data directly from your device with your explicit consent.</p>\r\n\r\n<p><strong>3. Use of </strong><strong>Information</strong></p>\r\n\r\n<p>We use the collected information for the following purposes:</p>\r\n\r\n<p>- Providing and improving our financial tools, payments, and services</p>\r\n\r\n<p>- Processing transactions and managing accounts</p>\r\n\r\n<p>- Communicating with you regarding account-related updates, promotions, and offers</p>\r\n\r\n<p>- Complying with legal and regulatory requirements</p>\r\n\r\n<p>- <strong>Contact List:</strong> To enable features such as seamless payments to your contacts, suggesting friends to connect with on our platform, and improving the overall user experience.</p>\r\n\r\n<p>- <strong>Images:</strong> To verify your identity, personalize your profile, and enhance security measures.</p>\r\n\r\n<p><strong>4. Data </strong><strong>Sharing</strong></p>\r\n\r\n<p>We may share your personal information with:</p>\r\n\r\n<p>- Financial partners and service providers to facilitate transactions and deliver services</p>\r\n\r\n<p>- Regulatory authorities and law enforcement agencies as required by law or to protect our legal interests</p>\r\n\r\n<p>- Affiliates and subsidiaries within our corporate group for business purposes</p>\r\n\r\n<p>- <strong>Third-party services:</strong> To process and store images securely and integrate contact list functionalities, ensuring compliance with privacy and security standards.</p>\r\n\r\n<p><strong>5. User Consent and Control</strong></p>\r\n\r\n<p>You have the right to:</p>\r\n\r\n<p>- Access, review, and update your personal information stored in our systems</p>\r\n\r\n<p>- Opt-out of receiving marketing communications from us</p>\r\n\r\n<p>- Request deletion of your account and associated data, subject to legal obligations</p>\r\n\r\n<p>- <strong>Manage Permissions:</strong> You can control and manage the permissions granted to our app for accessing your contact list and images through your device settings.</p>\r\n\r\n<p><strong>6. Data </strong><strong>Security</strong></p>\r\n\r\n<p>We implement robust security measures to protect your personal information from unauthorized access, disclosure, alteration, or destruction. These measures include:</p>\r\n\r\n<p>1. <strong>Encryption:</strong> Contact details and images stored in our databases are encrypted to protect them from unauthorized access or interception.</p>\r\n\r\n<p>2. <strong>Access Controls:</strong> We implement stringent access controls to ensure that only authorized personnel have access to contact information and images.</p>\r\n\r\n<p>3. <strong>Regular Review:</strong> Our security protocols undergo regular reviews and updates to maintain the confidentiality and integrity of stored data.</p>\r\n\r\n<p><strong>7. Data </strong><strong>Retention</strong></p>\r\n\r\n<p>We retain your personal information only for as long as necessary to fulfill the purposes outlined in this Privacy Policy and to comply with legal and regulatory requirements. When no longer needed, we securely delete or anonymize your data.</p>\r\n\r\n<p><strong>8. Updates to the Privacy Policy</strong></p>\r\n\r\n<p>We may update this Privacy Policy periodically to reflect changes in our business practices, legal requirements, or technological advancements. We will notify you of any material changes and seek your consent if required by law.</p>\r\n\r\n<p><strong>9. Contact Information</strong></p>\r\n\r\n<p>If you have questions, concerns, or requests regarding your privacy or this Privacy Policy, please contact us at:</p>\r\n\r\n<p><a href=\"mailto:info@sanaa.co\">info@sanaa.co</a></p>\r\n\r\n<p>256706272481</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',NULL,'2024-05-17 23:43:07'),(36,'terms_and_conditions','<p>Empower your financial journey with Sanaa Fi &ndash; where payments, banking, and cash flow seamlessly unite. Your bold path to financial success starts here.</p>\r\n\r\n<p><strong>1. Sanaa Account Registration</strong></p>\r\n\r\n<p><em>Provide accurate personal information during registration and keep the information current. We can suspend or terminate your account if you provide incomplete or false information.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>You are responsible for all activity on your account.</em></p>\r\n\r\n<p>You must open an account with UG (a &ldquo;Sanaa Account&rdquo;) to use the Services. During registration we will ask you for information, which may include but is not limited to, your name and other personal information. You must provide accurate and complete information in response to our questions, and you must keep that information current. You are fully responsible for all activity that occurs under your Sanaa Account, including for any actions taken by persons to whom you have granted access to the Sanaa Account. We reserve the right to change the account type, suspend or terminate the Sanaa Account of anyone who provides inaccurate, untrue, or incomplete information, or who fails to comply with the account registration requirements.</p>\r\n\r\n<p><strong>2. Revisions, Disclosures and Notices</strong></p>\r\n\r\n<p><em>We can make updates to our terms of service at any time, and we&rsquo;ll notify you of these updates as appropriate. By continuing to use our services after these updates, you agree to the revised terms.</em></p>\r\n\r\n<p><em>You also agree to receive notices from UG electronically.</em></p>\r\n\r\n<p>We may amend the Terms at any time with notice that we deem to be reasonable under the circumstances, by posting the revised version on our website or communicating it to you through the Services (each a &ldquo;Revised Version&rdquo;). The Revised Version will be effective as of the time it is posted, but will not apply retroactively. Your continued use of the Services after the posting of a Revised Version constitutes your acceptance of such Revised Version.</p>\r\n\r\n<p>You agree to <a href=\"https://docs.google.com/document/d/1dv7wGYqLN5k85A9QOaEnRdmSvh469gFlyYqCc8sCQw0/edit#\">Sanaa&rsquo;s E-Sign Consent</a>. We may provide disclosures and notices required by law and other information about your Sanaa Account to you electronically, by posting it on our website, pushing notifications through the Services, or by emailing it to the email address listed in your Sanaa Account or that you otherwise provided to Sanaa. Electronic disclosures and notices have the same meaning and effect as if we had provided you with paper copies. Such disclosures and notices are considered received by you within twenty-four (24) hours of the time posted to our website, or within twenty-four (24) hours of the time emailed to you unless we receive notice that the email was not delivered. If you wish to withdraw your consent to receiving electronic communications, contact <a href=\"https://docs.google.com/document/d/1dv7wGYqLN5k85A9QOaEnRdmSvh469gFlyYqCc8sCQw0/edit#\">Sanaa Support</a>. If we are not able to support your request, you may need to terminate your Sanaa Account.</p>\r\n\r\n<p><strong>3. Restrictions</strong></p>\r\n\r\n<p><em>If you want to use our services, you can&rsquo;t do certain bad things. If we think you are doing these bad things, we have the right to share your information with law enforcement.</em></p>\r\n\r\n<p>Except where prohibited by law, you may not, nor may you permit any third party, directly or indirectly, to:</p>\r\n\r\n<ul>\r\no<li>export the Services, which may be subject to export restrictions imposed by UG law, including UG Export Administration Regulations (15 C.F.R. Chapter VII);</li>\r\no<li>engage in any activity that may be in violation of regulations administered by the United States Department of the Treasury&rsquo;s Office of Foreign Asset Control (31 C.F.R. Parts 500-599). Prohibited activity includes but is not limited to the provision of Services to or for the benefit of a jurisdiction, entity, or individual blocked or prohibited by relevant sanctions authorities, including but not limited to activities in Iran, Cuba, North Korea, Syria, or the Crimean Region of the Ukraine. If found to be in apparent violation of these restrictions, your account could be terminated and your funds could be held for an indefinite period of time;</li>\r\no<li>access or monitor any material or information on any Sanaa system using any manual process or robot, spider, scraper, or other automated means;</li>\r\no<li>except to the extent that any restriction is expressly prohibited by law, violate the restrictions in any robot exclusion headers on any Service, work around, bypass, or circumvent any of the technical limitations of the Services, use any tool to enable features or functionalities that are otherwise disabled in the Services, or decompile, disassemble or otherwise reverse engineer the Services;</li>\r\no<li>perform or attempt to perform any actions that would interfere with the proper working of the Services, prevent access to or use of the Services by our other customers, or impose an unreasonable or disproportionately large load on our infrastructure;</li>\r\no<li>copy, reproduce, alter, modify, create derivative works, publicly display, republish, upload, post, transmit, resell or distribute in any way material, information or Services from Sanaa;</li>\r\no<li>use and benefit from the Services via a rental, lease, timesharing, service bureau or other arrangement;</li>\r\no<li>transfer any rights granted to you under these General Terms;</li>\r\no<li>use the Services in a way that distracts or prevents you from obeying traffic or safety laws;</li>\r\no<li>use the Services for the sale of firearms, firearm parts, ammunition, weapons or other devices designed to cause physical harm;</li>\r\no<li>use the Services for any illegal activity or goods or in any way that exposes you, other Sanaa users, our partners, or Sanaa to harm; or</li>\r\no<li>otherwise use the Services except as expressly allowed under these Terms.</li>\r\n</ul>\r\n\r\n<p>If we reasonably suspect that your Sanaa Account has been used for an unauthorized, illegal, or criminal purpose, you give UG express authorization to share information about you, your Sanaa Account, and any of your transactions with law enforcement.</p>\r\n\r\n<p><strong>4. Compatible Mobile Devices and Third Party Carriers</strong></p>\r\n\r\n<p>We do not warrant that the Services will be compatible with your mobile device or carrier. Your use of the Services may be subject to the terms of your agreements with your mobile device manufacturer or your carrier. You may not use a modified device to use the Services if the modification is contrary to the manufacturer&rsquo;s software or hardware guidelines, including disabling hardware or software controls&mdash;sometimes referred to as &ldquo;jail broken.&rdquo;</p>\r\n\r\n<p><strong>5. Your Content</strong></p>\r\n\r\n<p><em>You retain all rights to your content when you upload it into our services, but you do give UG broad rights to use, modify, display your content in our services. You can see specifics on the rights you grant UG below.</em></p>\r\n\r\n<p><em>Also, anything you provide UG or make available to the public through our services must not contain anything that we think is objectionable (e.g., illegal, obscene, hateful or harmful to you, our customers or us). We can remove any content at any time.</em></p>\r\n\r\n<p>The Services may include functionality for uploading or providing suggestions, recommendations, feedback, stories, photos, documents, logos, products, loyalty programs, promotions, advertisements and other materials or information (&ldquo;Content&rdquo;).</p>\r\n\r\n<p>You grant UG and our subsidiaries, affiliates, and successors a worldwide, non-exclusive, royalty-free, fully-paid, transferable, irrevocable, perpetual, and sub-licensable right to use, reproduce, modify, adapt, publish, prepare derivative works of, distribute, publicly perform, and publicly display your Content throughout the world in any media for any reason, including to provide, promote, and/or incorporate into the Services. You retain all rights in your Content, subject to the rights you granted to UG in these General Terms. You may modify or remove your Content via your Sanaa Account or by terminating your Sanaa Account, but your Content may persist in historical, archived or cached copies and versions thereof available on or through the Services.</p>\r\n\r\n<p>You will not upload or provide Content or otherwise post, transmit, distribute, or disseminate through the Services any material that: (a) is false, misleading, unlawful, obscene, indecent, lewd, pornographic, defamatory, libelous, threatening, harassing, hateful, abusive, or inflammatory; (b) encourages conduct that would be considered a criminal offense or gives rise to civil liability; (c) breaches or infringes any duty toward or rights of any person or entity, including rights of publicity, privacy or Intellectual Property Rights; (d) contains corrupted data or any other harmful, disruptive, or destructive files; (e) advertises products or services competitive with Sanaa&rsquo;s or its partners&rsquo; products and services, as determined by UG in our sole discretion; or (f) in our sole judgment, is objectionable, restricts or inhibits any person or entity from using or enjoying any portion of the Services, or which may expose Sanaa, its affiliates or its customers or other persons to harm or liability of any nature.</p>\r\n\r\n<p>Although we have no obligation to monitor any Content, we have absolute discretion to remove Content at any time and for any reason without notice. Sanaa may also monitor such Content to detect and prevent fraudulent activity or violations of Sanaa&rsquo;s General Terms. You understand that by using the Services, you may be exposed to Content that is offensive, indecent, or objectionable. We take no responsibility and assume no liability for any Content, including any loss or damage to any of your Content.</p>\r\n\r\n<p><strong>6. Copyright and Trademark Infringement</strong></p>\r\n\r\n<p>We respect the intellectual property rights of others and ask you to do the same. We have adopted an <a href=\"https://squareup.com/legal/copyright\">Intellectual Property Policy</a> regarding third-party claims that your material infringes the rights of others. We respond to all valid notices of such infringement, and our policy is to suspend or terminate the accounts of repeat infringers.</p>\r\n\r\n<p><strong>7. Security</strong></p>\r\n\r\n<p><em>We take security incredibly seriously, but can&rsquo;t guarantee that bad actors will not gain access to your personal information. You need to do your part by keeping your passwords safe, being smart about who has access to your account and which of your devices can access our services, and letting UG know if you think an unauthorized person is using your account.</em></p>\r\n\r\n<p><em>If there is ever a dispute about who owns your account, we are the decider.</em></p>\r\n\r\n<p>We have implemented technical and organizational measures designed to secure your personal information from accidental destruction, loss, alteration and from unauthorized access, use, alteration, or disclosure. However, we cannot guarantee that unauthorized third parties will never be able to defeat those measures or use your personal information for improper purposes. You provide your personal information at your own risk.</p>\r\n\r\n<p>You are solely responsible for safeguarding your password and for restricting access to the Services from your compatible mobile devices and computer(s). You will immediately notify UG of any unauthorized use of your password or Sanaa Account or any other breach of security. You will immediately take all reasonable steps to mitigate the effects of a security breach and will cooperate with Sanaa and provide all information requested by Sanaa to remediate the breach. Any assistance provided by Sanaa in relation to a security breach does not in any way operate as acceptance or acknowledgement that Sanaa is in any way responsible or liable to you or any other party in connection with such breach.</p>\r\n\r\n<p>Notwithstanding Sections 21 and 22, in the event of any dispute between two or more parties as to account ownership, we will be the sole arbiter of such dispute in our sole discretion. Our decision (which may include termination or suspension of any Sanaa Account subject to dispute) will be final and binding on all parties.</p>\r\n\r\n<p><strong>8. Privacy</strong></p>\r\n\r\n<p>Your Personal Information By using any of our Services as a Sanaa seller, you acknowledge our data practices that apply to you, as set out in the <a href=\"https://squareup.com/legal/privacy\">Sanaa Account Holder Privacy Notice</a> (the &ldquo;Privacy Notice&rdquo;). The Privacy Notice explains how Sanaa collects, uses and protects the personal information you provide to UG where Sanaa makes use of your personal data to provide you with the Services or for its own purposes. You are required to familiarize yourself with the Privacy Notice prior to using the Services.</p>\r\n\r\n<p>Your Customers&rsquo; and Employees&rsquo; Personal Information Sanaa will process certain of your customers&rsquo; or employees&rsquo; personal data on behalf of your business as a service provider (&ldquo;data processor&rdquo;). In such circumstances, you agree that you will comply with the data protection laws applicable to you and will provide data subjects with information on the processing of their personal information which satisfies the transparency requirements of such data protection laws and which ensures that personal data may be processed fairly, lawfully and in a transparent manner. If you or your business are located in UG , Colorado, Connecticut, Utah, or Virginia, please see <a href=\"https://squareup.com/us/en/legal/general/ua#state-specific-privacy-terms\">Section 28</a>.</p>\r\n\r\n<p><strong>9. Communications</strong></p>\r\n\r\n<p><em>You consent to UG sending messages to your email or mobile devices about your account or our services, which may include marketing. You can opt out of communications in ways that are specific to that communication method, such as by unsubscribing from emails, or replying to text messages with &lsquo;STOP&rsquo;.</em></p>\r\n\r\n<p>You consent to accept and receive communications from us, including e-mail, text messages, calls, and push notifications to the cellular telephone number you provide to UG when you sign-up for a Sanaa account or update the contact information associated with your account. Such communications may include, but are not limited to requests for secondary authentication, receipts, reminders, notifications regarding updates to your account or account support, and marketing or promotional communications. You acknowledge that you are not required to consent to receive promotional texts or calls as a condition of using the Services. Call and text message communications may be generated by automatic telephone dialing systems. Standard message and data rates applied by your cell phone carrier may apply to the text messages we send you.</p>\r\n\r\n<p>You may opt-out of receiving promotional email communications we send to you by following the unsubscribe options on such emails. You may opt out of any promotional phone calls by informing the caller that you would not like to receive future promotional calls. You may only opt-out of text messages from Sanaa by replying STOP. You acknowledge that opting out of receiving communications may impact your use of the Services.</p>\r\n\r\n<p>We also provide Services that allow you to send short message service (SMS) messages to your customers (the &ldquo;Seller-Initiated SMS Services&rdquo;). You will only use the Seller-Initiated SMS Services in compliance with these Terms and all other applicable laws and regulations of the jurisdiction from which you send messages and in which your messages are received.</p>\r\n\r\n<p><strong>10. Paid Services</strong></p>\r\n\r\n<p><em>Lots of what we offer is free, but we offer paid services too. We can collect payments for a paid service by either charging your linked debit/credit card or taking the payment from your transaction proceeds, Sanaa-account balance or linked bank account.</em></p>\r\n\r\n<p><em>We&rsquo;ll give you 30 days advance notice if we change our subscription fees, and you can cancel your subscription at any time.</em></p>\r\n\r\n<p>Sanaa&rsquo;s Services include both paid-for Services (&ldquo;Paid Services&rdquo;) and free Services, for which no additional fees are charged (&ldquo;Free Services&rdquo;). Sanaa offers certain Paid Services to be paid for on a recurring basis (&ldquo;Subscription Services&rdquo;) and others on an as-used basis (&ldquo;A La Carte Services&rdquo;). Subscription Services may subject you to recurring fees and/or terms. By signing up for a Subscription Service, including after any free trial period, you agree to pay UG the subscription fee and any applicable Taxes (as defined below) (&ldquo;Subscription Fee&rdquo;). A La Carte Services may subject you to fees charged per usage and/or terms, including transaction volume. By using an A La Carte Service, you agree to pay the fees and any Taxes incurred at the time of usage (&ldquo;A La Carte Fees&rdquo; and, together with Subscription Fees, the &ldquo;Paid Service Fees&rdquo;). See <a href=\"https://squareup.com/legal/payment\">Payment Terms</a> for terms applicable to Payment Services.</p>\r\n\r\n<p>In general, Paid Service Fees may be paid by debit card, credit card, or deducted from your transaction proceeds; however, Paid Service Fees related to hardware may only be paid by debit card or credit card. If you link a debit or credit card to your account, you authorize UG to collect Paid Service Fees by debit from your linked debit card or charge to your linked credit card. Regardless of payment device or method, we reserve the right to collect Paid Service Fees by deduction from your transaction proceeds, the Balance (as defined in the Payment Terms) in your Sanaa Account or your linked bank account.</p>\r\n\r\n<p>Unless otherwise provided in a Subscription Service&rsquo;s terms, Subscription Fees will be charged on the first of every month until canceled. You may cancel a Subscription Service at any time from your Sanaa Account settings. If you cancel a Subscription Service, you will continue to have access to that Subscription Service through the end of your then current billing period, but you will not be entitled to a refund or credit for any Subscription Fee already due or paid. We reserve the right to change our Subscription Fee upon thirty (30) days&rsquo; advance notice. Your continued use of Subscription Services after notice of a change to our Subscription Fee will constitute your agreement to such changes.</p>\r\n\r\n<p><strong>11. Taxes</strong></p>\r\n\r\n<p><em>Your Taxes are your responsibility. But we may have an obligation under applicable law to charge and/or remit Tax on Paid Services and report certain information about you to the IRS or other applicable Tax authority.</em></p>\r\n\r\n<p>For purposes of these Terms, &ldquo;Tax&rdquo; and &ldquo;Taxes&rdquo; include any and all present or future taxes, charges, fees, levies or other assessments, including, without limitation, income, telecommunications, value-added, goods and services tax or similar taxes, stamp tax or duty, gross receipts, excise, real or personal property, sales, withholding, social security, occupation, use, severance, environmental, license, net worth, payroll, employment, franchise, transfer and recording taxes, fees and charges, imposed by any domestic or foreign Taxing authority, including any penalties, interest or additions to tax (collectively, &ldquo;Taxes&rdquo;).</p>\r\n\r\n<p>Unless otherwise expressly stated, all Paid Services Fees are exclusive of any Taxes. You are responsible and liable for identifying and calculating any and all Taxes required to be assessed, incurred, collected, paid or withheld for your use of the Services. Unless otherwise expressly stated, You also are responsible and liable for (a) determining whether Taxes apply to your sale of products and services, payments received, bill payments make or received, and/or any other transactions arising from or out of your use of the Services, and (b) registering with Tax authorities in jurisdictions where you are required to do so by applicable law, and (c) calculating, collecting, reporting, paying, and/or remitting any such applicable Taxes to the appropriate Tax and revenue authority. Sanaa specifically disclaims any liability for such Taxes and you agree to fully indemnify, defend, and hold Sanaa harmless against any such Taxes and any other related expenses or costs. Notwithstanding anything in these Terms to the contrary, You agree that we are not a marketplace, marketplace facilitator, marketplace provider, or similar construct under any applicable law relating to sales, use, or similar taxes, nor do the Services hereunder provide a marketplace or similar construct, and You agree to not take any tax position to the contrary, including on any tax return, tax filing, in any tax audit or examination or otherwise.</p>\r\n\r\n<p>Notwithstanding the foregoing, Sanaa may charge applicable Taxes on Services, as required by law, which you agree to pay, unless you provide Sanaa with timely appropriate, complete, and accurate information and documentation satisfying the legal and Tax requirements of the relevant governmental or Tax authority to establish that the otherwise applicable Tax is not required to be charged by Sanaa. You agree to fully indemnify, defend and hold Sanaa harmless against any Tax imposed by a Tax authority for failure to apply correct Taxes if such failure is a result of your failure to provide Sanaa with the correct evidence to support your exemption from such Taxes, as applicable.</p>\r\n\r\n<p>Sanaa may be obligated under applicable laws to report certain information to tax and revenue authorities (&ldquo;Tax Information&rdquo;) and/or you with respect to your use of the Services. Upon request, you shall provide Sanaa with the necessary information to complete any applicable Tax Information reporting and recertify such information from time to time, as may be required by applicable law, or otherwise in connection with any Tax audit or examination. If you use our Services you acknowledge that we will report to the applicable Tax and revenue authorities the required Tax Information (including the total number and amount of payments you received during the relevant reporting period). We also may, but are not obligated to, send to you the Tax Information reported.</p>\r\n\r\n<p>If applicable, Sanaa shall be entitled to deduct from any payments to you the amount of any applicable withholding Taxes with respect to amounts payable, or any other Taxes, in each case required to be withheld by Sanaa to the extent that Sanaa remits to the appropriate Tax authority on your behalf such Taxes. Any amounts so deducted or withheld shall be treated as having been paid for all purposes of these Terms and Sanaa will not be obliged to increase or gross-up any payment on account of any withholding of Tax.</p>\r\n\r\n<p>You acknowledge and agree that Sanaa is not providing any Tax advice and nothing Sanaa says or provides to you should be interpreted as such. For any Tax-related inquiries in connection with the Services or these Terms, you should consult your own Tax or legal advisor.</p>\r\n\r\n<p><strong>12. Modification and Termination</strong></p>\r\n\r\n<p><em>We can terminate or deny you access to our services at any time, for any reason. You can also choose to deactivate your account at any time.</em></p>\r\n\r\n<p>We may terminate these General Terms or any Additional Terms, or suspend or terminate your Sanaa Account or your access to any Service, at any time for any reason. We may add or remove, suspend, stop, delete, discontinue or impose conditions on Services or any feature or aspect of a Service. We will take reasonable steps to notify you of termination or these other types of Service changes by email or at the next time you attempt to access your Sanaa Account. You may also terminate the General Terms and Additional Terms applicable to your Sanaa Account by deactivating your Sanaa Account at any time.</p>\r\n\r\n<p><strong>13. Effect of Termination</strong></p>\r\n\r\n<p><em>Once our relationship ends, we are not responsible for any losses you experience because of the termination of our services or for removing your data from our servers. Some terms of our agreement will still apply even after our relationship ends.</em></p>\r\n\r\n<p>If these General Terms or your Sanaa Account is terminated or suspended for any reason: (a) the license and any other rights granted under these Terms will end, (b) you agree to immediately terminate and cease use of all Services, (c) we may (but have no obligation to) delete your information and account data stored on our servers, and (c) we will not be liable to you or any third party for compensation, reimbursement, or damages for any termination or suspension of the Services, or for deletion of your information or account data. In addition to any payment obligations under the Payment Terms, the following sections of these General Terms survive and remain in effect in accordance with their terms upon termination: 5 (Your Content), 6 (Copyright and Trademark Infringement), 7 (Security), 8 (Privacy), 13 (Effect of Termination), 15 (Ownership), 16 (Indemnity), 17 (Representations and Warranties), 18 (No Warranties), 19 (Limitation of Liability and Damages), 20 (Third Party Products), 21 (Disputes), 22 (Binding Individual Arbitration), 23 (Governing Law), 24 (Limitation on Time to Initiate a Dispute), 25 (Assignment), 26 (Third Party Service and Links to Other Web Sites), and 29 (Other Provisions).</p>\r\n\r\n<p><strong>14. Your License</strong></p>\r\n\r\n<p>We grant you a limited, non-exclusive, revocable, non-transferable, non-sublicensable license to use the Paid Services, and a royalty-free, limited, non-exclusive, revocable, non-transferable, non-sublicensable license to use the Free Services as authorized in these General Terms. We may make updates to the Services available to you, which you must accept to continue using the Services. Any such updates may be subject to additional terms made known to you at that time.</p>\r\n\r\n<p><strong>15. Ownership</strong></p>\r\n\r\n<p><em>While we&rsquo;re happy to let you use our services, you don&rsquo;t have any ownership rights in them. We can act on any ideas you share with UG about how we can improve our products and services free of charge.</em></p>\r\n\r\n<p>We reserve all rights not expressly granted to you in these General Terms. The Services are protected by copyright, trademark, patent and other laws of the United States and other countries. We own all rights, title, and interest, in and to the Services and all copies of the Services. These General Terms do not grant you any rights to our trademarks or service marks.</p>\r\n\r\n<p>For the purposes of these General Terms, &ldquo;Intellectual Property Rights&rdquo; means all patent rights, copyright rights, mask work rights, moral rights, rights of publicity, trademark, trade dress and service mark rights, goodwill, trade secret rights, and other intellectual property rights that may exist now or come into existence in the future, and all of their applications, registrations, renewals and extensions, under the laws of any state, country, territory or other jurisdiction.</p>\r\n\r\n<p>You may submit feedback, comments or ideas about the Services (&ldquo;Ideas&rdquo;). Submitting Ideas is entirely voluntary, and we will be free to use such ideas as we see fit without any obligation to you.</p>\r\n\r\n<p><strong>16. Indemnity</strong></p>\r\n\r\n<p><em>If you do something using our services that gets UG sued or fined, you agree to cover our losses as described below.</em></p>\r\n\r\n<p>You will indemnify, defend, and hold UG and our processors (and our respective employees, directors, agents, affiliates and representatives) harmless from and against any and all claims, costs, losses, damages, judgments, tax assessments, penalties, interest, and expenses (including without limitation reasonable attorneys&rsquo; fees) arising out of or in connection with any claim, action, audit, investigation, inquiry, or other proceeding instituted by any person or entity that arises out of or relates to: (a) any actual or alleged breach of your representations, warranties, or obligations set forth in these Terms; (b) your wrongful or improper use of the Services; (c) your violation of any third-party right, including without limitation any right of privacy, publicity rights or Intellectual Property Rights; (d) your violation of any law, rule or regulation of the United States or any other country or any inaccuracy in any Tax Information provided hereunder; (e) any third-party claims made by your Buyer regarding Sanaa&rsquo;s processing of your customer/Buyer&rsquo;s Personal Information in connection with providing you with the Services; and (f) any other party&rsquo;s access and/or use of the Services with your unique name, password or other appropriate security code; and (g) any transaction, purchase, good or service in respect of which Sanaa provides, or provided, you with payment processing services in accordance with the Terms.</p>\r\n\r\n<p><strong>17. Representations and Warranties</strong></p>\r\n\r\n<p><em>Here&rsquo;s the part where you promise that you are who you say you are, and that you will obey the law and our terms.</em></p>\r\n\r\n<p>You represent and warrant to UG that: (a) you are at least eighteen (18) years of age; (b) you are located in the United States; (c) you are eligible to register and use the Services and have the right, power, and ability to enter into and perform under these General Terms; (d) any information you provide in connection with the Services, including your business name, accurately and truthfully represents your business or personal identity under which you sell goods and services; (e) you and all transactions initiated by you will comply with all federal, state, and local laws, rules, and regulations applicable to you and/or your business, including the Health Insurance Portability and Accountability Act (&ldquo;HIPAA&rdquo;); (f) you will not use the Services, directly or indirectly, for any fraudulent undertaking or in any manner so as to interfere with the operation of the Services; and (g) your use of the Services will be in compliance with these Terms.</p>\r\n\r\n<p><strong>18. No Warranties</strong></p>\r\n\r\n<p><em>While we do our best to bring great products and services to our customers, we provide them as-is, without warranties. We are not responsible for any goods and services that you might buy or sell using Sanaa&rsquo;s services.</em></p>\r\n\r\n<p>THE USE OF &ldquo;Sanaa&rdquo; IN SECTIONS 18 AND 19 MEANS Sanaa, ITS PROCESSORS, ITS SUPPLIERS, AND ITS LICENSORS (AND THEIR RESPECTIVE SUBSIDIARIES, AFFILIATES, AGENTS, DIRECTORS, AND EMPLOYEES).</p>\r\n\r\n<p>THE SERVICES ARE PROVIDED &ldquo;AS IS&rdquo; WITHOUT REPRESENTATION OR WARRANTY, WHETHER IT IS EXPRESS, IMPLIED, OR STATUTORY. WITHOUT LIMITING THE FOREGOING, Sanaa SPECIFICALLY DISCLAIMS ANY IMPLIED WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, OR NON-INFRINGEMENT.</p>\r\n\r\n<p>Sanaa DOES NOT WARRANT, REPRESENT OR GUARANTEE IN ANY WAY THAT THE SERVICES ARE ACCURATE, RELIABLE OR CORRECT; THAT THE SERVICES WILL MEET YOUR REQUIREMENTS; THAT THE SERVICES WILL BE AVAILABLE AT ANY PARTICULAR TIME OR LOCATION, UNINTERRUPTED, ERROR-FREE, WITHOUT DEFECT OR SECURE; THAT ANY DEFECTS OR ERRORS IN THE SERVICES WILL BE CORRECTED; OR THAT THE SERVICES ARE FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS OR FIT FOR ANY PARTICULAR PURPOSE.</p>\r\n\r\n<p>Sanaa does not warrant, endorse, guarantee, or assume responsibility or liability for any product or service advertised or offered by a third party. Sanaa does not have control of, or liability for, goods or services that are paid for using the Services.</p>\r\n\r\n<p><strong>19. Limitations of Liability and Damages</strong></p>\r\n\r\n<p><em>As described below, if something bad happens because of your use of our services, our liability is capped.</em></p>\r\n\r\n<p>TO THE MAXIMUM EXTENT PERMITTED BY APPLICABLE LAW, IN NO EVENT WILL Sanaa BE LIABLE FOR ANY DIRECT, INDIRECT, PUNITIVE, INCIDENTAL, SPECIAL, CONSEQUENTIAL, OR EXEMPLARY DAMAGES, INCLUDING WITHOUT LIMITATION DAMAGES FOR LOSS OF PROFITS, GOODWILL, USE, DATA, OR OTHER INTANGIBLE LOSSES, THAT RESULT FROM THE USE OF, INABILITY TO USE, OR UNAVAILABILITY OF THE SERVICE. IN ALL CASES, Sanaa WILL NOT BE LIABLE FOR ANY LOSS OR DAMAGE THAT IS NOT REASONABLY FORESEEABLE.</p>\r\n\r\n<p>UNDER NO CIRCUMSTANCES WILL Sanaa BE RESPONSIBLE FOR ANY DAMAGE, LOSS, OR INJURY RESULTING FROM HACKING, TAMPERING, OR OTHER UNAUTHORIZED ACCESS OR USE OF THE SERVICES OR YOUR Sanaa ACCOUNT, OR THE INFORMATION CONTAINED THEREIN.</p>\r\n\r\n<p>TO THE MAXIMUM EXTENT PERMITTED BY APPLICABLE LAW, THE TOTAL LIABILITY OF Sanaa IS LIMITED TO THE GREATER OF (A) THE AMOUNT OF FEES EARNED BY UG IN CONNECTION WITH YOUR USE OF THE SERVICES DURING THE THREE (3) MONTH PERIOD IMMEDIATELY PRECEDING THE EVENT GIVING RISE TO THE CLAIM FOR LIABILITY, OR (B) $500.</p>\r\n\r\n<p>THIS LIMITATION OF LIABILITY SECTION APPLIES WHETHER THE ALLEGED LIABILITY IS BASED ON CONTRACT, TORT, NEGLIGENCE, STRICT LIABILITY, OR ANY OTHER BASIS, EVEN IF Sanaa HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGE. THE FOREGOING LIMITATION OF LIABILITY WILL APPLY TO THE FULLEST EXTENT PERMITTED BY LAW IN THE APPLICABLE JURISDICTION.</p>\r\n\r\n<p><strong>20. Third Party Products</strong></p>\r\n\r\n<p>All third party hardware and other products included or sold with the Services are provided solely according to the warranty and other terms specified by the manufacturer, who is solely responsible for service and support for its product. For service, support, or warranty assistance, you should contact the manufacturer directly. Sanaa MAKES NO REPRESENTATIONS OR WARRANTIES, EXPRESS OR IMPLIED, WITH RESPECT TO SUCH THIRD PARTY PRODUCTS, AND EXPRESSLY DISCLAIMS ANY WARRANTY OR CONDITION OF MERCHANTABILITY, NON-INFRINGEMENT, OR FITNESS FOR A PARTICULAR PURPOSE.</p>\r\n\r\n<p><strong>21. Disputes</strong></p>\r\n\r\n<p><em>When you see the word &ldquo;Dispute&rdquo; in these terms, here&rsquo;s what it means.</em></p>\r\n\r\n<p>&ldquo;Disputes&rdquo; are defined as any claim, controversy, or dispute between you and Sanaa, its processors, suppliers or licensors (or their respective affiliates, agents, directors or employees), whether arising before or during the effective period of these Terms, and including any claim, controversy, or dispute based on any conduct of you or Sanaa that occurred before the effective date of these Terms, including any claims relating in any way to these Terms or the Services, or any other aspect of our relationship.</p>\r\n\r\n<p><strong>22. Binding Individual Arbitration</strong></p>\r\n\r\n<p><em>This section provides details about how we will resolve disputes through the arbitration process.</em></p>\r\n\r\n<p>General. You and Sanaa agree that any and all Disputes, except those that are resolved informally or brought in a small claims court, will be arbitrated by a neutral arbitrator who has the power to award the same individual damages and individual relief that a court can. ANY ARBITRATION UNDER THESE GENERAL TERMS WILL ONLY BE ON AN INDIVIDUAL BASIS; CLASS ARBITRATIONS, CLASS ACTIONS, REPRESENTATIVE ACTIONS, AND CONSOLIDATION WITH OTHER ARBITRATIONS ARE NOT PERMITTED. YOU WAIVE ANY RIGHT TO HAVE YOUR CASE DECIDED BY A JURY AND YOU WAIVE ANY RIGHT TO PARTICIPATE IN A CLASS ACTION AGAINST Sanaa. If any provision of this arbitration agreement is found unenforceable, the unenforceable provision will be severed, and the remaining arbitration terms will be enforced (but in no case will there be a class or representative arbitration).</p>\r\n\r\n<p>Pre-Filing Requirement to Attempt to Resolve Disputes. Before an arbitration is commenced, you or Sanaa agree to attempt to avoid the costs of formal dispute resolution by giving each other a full and fair opportunity to address and resolve a Dispute informally. Both parties recognize that this is an important requirement, and that breach of this requirement would be a material breach of the Terms. To provide this opportunity, before commencing any arbitration or suit, each party agrees to send to the other party a written Notice (&ldquo;Notice&rdquo;). Any Notice to Sanaa should be sent by mail to Sanaa Finance, LTD., Attn: Sanaa Arbitration Provision, PO Box 72403, San Francisco, CA 94142. Any Notice sent to you will be sent to the address on file for your account. The Notice must: (i) include your name and account number; (ii) provide detailed information sufficient to evaluate the merits of the claiming party&rsquo;s individualized claim and for the other party to determine if an amicable resolution is possible; and (iii) set forth the specific relief sought, including whatever amount of money is demanded and the means by which the demanding party calculated the claimed damages. Both parties agree that they will attempt to resolve a dispute through an informal negotiation within sixty (60) days from the date the Notice is sent. After that sixty (60) day period and not before, either party may commence arbitration. Each party agrees that state courts in the City and County of San Francisco, UG , or federal court for the Northern District of UG , referenced below, may enter injunctive relief to enforce the pre-filing requirements of this paragraph, including an injunction to stay an arbitration that has been commenced in violation of this paragraph.</p>\r\n\r\n<p>Scope of Arbitration. If we are not able to resolve the Dispute by informal negotiation or, as provided below, in a small claims court, all Disputes will be resolved finally and exclusively by binding individual arbitration with a single arbitrator (the &ldquo;Arbitrator&rdquo;) administered by the American Arbitration Association (https://www.adr.org) according to this Section and the <a href=\"https://www.adr.org/sites/default/files/Commercial%20Rules.pdf\">Commercial Arbitration Rules</a> for that forum, except you and Sanaa will have the right to file early or summary dispositive motions and to request that the AAA&rsquo;s Expedited Procedures apply regardless of the claim amount. Except as set forth above, the Arbitrator shall be responsible for determining all threshold arbitrability issues, including issues relating to whether the General Terms and/or Additional Terms (or any aspect thereof) are enforceable, unconscionable or illusory and any defense to arbitration, including waiver, delay, laches, or estoppel.</p>\r\n\r\n<p>Small Claims Court. Subject to applicable jurisdictional requirements, either party may elect to pursue a Dispute in a local small-claims court rather than through arbitration so long as the matter remains in small claims court and proceeds only on an individual basis. If a party has already submitted an arbitration demand to the AAA, the other party may, in its sole discretion, inform the AAA that it chooses to have the Dispute heard in small claims court. At that time, the AAA will close the arbitration and the Dispute will be heard in the appropriate small claims court, with no fees due from the arbitration respondent.</p>\r\n\r\n<p>Arbitration Procedures. The Federal Arbitration Act, 9 U.S.C. &sect;&sect; 1-16, including its procedural provisions, fully applies. Any arbitration hearing will occur in San Francisco, UG , at another mutually agreeable location or, if both parties agree, by telephone or videoconference. The Arbitrator&rsquo;s award will be binding on the parties and may be entered as a judgment in any court of competent jurisdiction. Sanaa values your privacy, particularly with respect to your financial transactions and data. Each of the parties shall maintain the confidential nature of the arbitration and shall not (without the prior written consent of the other party) disclose to any third party the fact, existence, content, award, or other result of the arbitration, except as may be necessary to enforce, enter, or challenge such award in a court of competent jurisdiction or as otherwise required by applicable law. While an arbitrator may award declaratory or injunctive relief, the Arbitrator may do so only with respect to the individual party seeking relief and only to the extent necessary to provide relief warranted by the individual party&rsquo;s claim. The Arbitrator&rsquo;s decision and judgment thereon will not have a precedential or collateral estoppel effect.</p>\r\n\r\n<p>Arbitration Fees. In accordance with the AAA Rules, the party initiating the arbitration (either you or us) is responsible for paying the applicable filing fee. For purposes of this arbitration provision, references to you and Sanaa also include respective subsidiaries, affiliates, agents, employees, predecessors, successors and assigns as well as authorized users or beneficiaries of the Services.</p>\r\n\r\n<p>Opt Out. You may reject this provision, in which case only a court may be used to resolve any Dispute. To reject this provision, you must send UG an opt-out notice (the &ldquo;Opt Out&rdquo;) within thirty (30) days after you create a Sanaa account or we first provide you with the right to reject this provision.</p>\r\n\r\n<p>The Opt Out must be mailed to Sanaa Finance, LTD., Attn: Sanaa Arbitration Provision, PO Box 72403, Kampala (U). For your convenience, we are providing an opt out <a href=\"https://squareup.com/legal/general/seller-opt-out\">notice form</a> you must fill in to Opt Out. You must complete this form by providing your name, address, phone number and the email address(es) you used to sign up and use the Services. This is the only way of opting out of this provision. Opting out will not affect any other aspect of the General Terms, Additional Terms, or the Services, and will have no effect on any other or future agreements you may reach to arbitrate with us.</p>\r\n\r\n<p>Court Proceedings. Subject to and without waiver of the arbitration provisions above, you agree that any judicial proceedings (other than small claims actions as discussed above) will be brought in and you hereby consent to the exclusive jurisdiction and venue in the state courts in the City and County of UG .</p>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>23. Governing Law</strong></p>\r\n\r\n<p><em>Our relationship is governed by the laws of UG , federal law, or both.</em></p>\r\n\r\n<p>These General Terms and any Dispute will be governed by the Federal Arbitration Act, as set forth above, and by UG&nbsp; law and/or applicable federal law, without regard to its choice of law or conflicts of law principles.</p>\r\n\r\n<p><strong>24. Limitation on Time to Initiate a Dispute</strong></p>\r\n\r\n<p>Any action or proceeding by you relating to any Dispute must commence within one year after the cause of action accrues.</p>\r\n\r\n<p><strong>25. Assignment</strong></p>\r\n\r\n<p><em>You may not transfer any rights you have under our terms of service to anyone else.</em></p>\r\n\r\n<p>Unless expressly authorized by Sanaa, these General Terms, and any rights and licenses granted hereunder, may not be transferred or assigned by you and any attempted transfer or assignment will be null and void.</p>\r\n\r\n<p><strong>26. Third Party Services and Links to Other Websites</strong></p>\r\n\r\n<p><em>While you&rsquo;re using our products and services, you may be offered services from third parties. We are not responsible for any issues you may have with them.</em></p>\r\n\r\n<p>You may be offered services, products and promotions provided by third parties and not by Sanaa, including, but not limited to, third party developers who use Sanaa&rsquo;s services (&ldquo;Third Party Services&rdquo;). If you decide to use Third Party Services, you will be responsible for reviewing and understanding the terms and conditions for these services. We are not responsible or liable for the performance of any Third Party Services. Further, you agree to resolve any disagreement between you and a third party regarding the terms and conditions of any Third Party Services with that third party directly in accordance with the terms and conditions of that relationship, and not Sanaa. The Services may contain links to third party websites. The inclusion of any website link does not imply an approval, endorsement, or recommendation by Sanaa. Such third party websites are not governed by these General Terms. You access any such website at your own risk. We expressly disclaim any liability for these websites. When you use a link to go from the Services to a third party website, our Privacy Notice is no longer in effect. Your browsing and interaction on a third party website, including those that have a link in the Services is subject to that website&rsquo;s own terms, rules and policies.</p>\r\n\r\n<p><strong>27. Third-Party Beneficiaries</strong></p>\r\n\r\n<p>No provision in these General Terms, and any applicable Additional Terms is intended or shall create any rights with respect to the subject matter of these General Terms, and any applicable Additional Terms in any third party.</p>\r\n\r\n<p><strong>28. State-Specific Privacy Terms</strong></p>\r\n\r\n<p>If you are a &ldquo;Business&rdquo; as defined by the URSB, or are a &ldquo;Controller&rdquo; subject to the Uganda, Connecticut&rsquo;s An Act Concerning Personal Data Privacy And Online Monitoring, the Utah Privacy Rights Act, or the Virginia Consumer Data Protection Act (collectively, &ldquo;State Privacy Laws&rdquo;), then this provision 28 applies to you. For purposes of this Section 28, &ldquo;process&rdquo;, &ldquo;sell&rdquo;, and &ldquo;business purpose(s)&rdquo; have the meaning ascribed to them by the State Privacy Laws.</p>\r\n\r\n<p>a) For purposes of this Section 28, &ldquo;Buyer Personal Information&rdquo; means any information that identifies, relates to, describes, is reasonably capable of being associated with, or could reasonably be linked, directly or indirectly, with a particular consumer or household that is processed by Sanaa in connection with its Services to you. Buyer Personal Information does not include information Sanaa receives about your customers (&ldquo;Buyers&rdquo;) for purposes of Sanaa&rsquo;s digital receipt, customer directory and email marketing tools (&ldquo;Sanaa Buyer Features&rdquo;), or for Sanaa Go. It does include information that your Buyer has provided you through Sanaa Appointments, Sanaa Invoices, or to receive Loyalty-related or promotional text messages. For details about our privacy practices with respect to Sanaa Buyer Features, please refer to our <a href=\"https://squareup.com/us/en/legal/general/buyer-features\">Buyer Features Privacy Notice</a>.</p>\r\n\r\n<p>b) We may receive Personal Information from Buyers for the purpose of performing Services 